	add("mountain", "{\"term\":\"mountain\", \"etymology\":{\"influencers\":[], \"languages\":[\"Welsh\", \"English\", \"middle english (1100-1500)\", \"Latin\", \"Albanian\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) from Anglo-norman {{m|fro|muntaine}}, from {{m|la|*montānea}}, feminine of {{m|la|*montāneus||mountainous}}, alteration of Latin {{m|la|montānus}}, from {{m|la|mōns||mountain}}, from Proto-indo-european {{m|ine-pro|*monti}} (compare Welsh {{m|cy|mynydd||mountain}}, Albanian {{m|sq|mat||bank, shore}}, Avestan {{rfscript|ae}} {{m|ae||tr\u003dmati||promontory}}), from Proto-indo-european {{m|ine-pro|*men-||to project, stick out}}. More at menace.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large mass of earth and rock, rising above the common level of the earth or adjacent land, usually given by geographers as above 1000 feet in height (or 304.8 metres), though such masses may still be described as hills in comparison with larger mountains\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Everest is the highest \u0027\u0027mountain\u0027\u0027 in the world\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We spent the weekend hiking in the \u0027\u0027mountains\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A large amount\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There\u0027s still a \u0027\u0027mountain\u0027\u0027 of work to do\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A difficult task or challenge\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A thick breast of a lady\", \"priority\":7}]}, \"synonyms\":{}}");

